// MARK: - Errors

/// Error enum for B2bi
public struct B2biErrorType: AWSErrorType {
    enum Code: String {
        case accessDeniedException = "AccessDeniedException"
        case conflictException = "ConflictException"
        case internalServerException = "InternalServerException"
        case resourceNotFoundException = "ResourceNotFoundException"
        case serviceQuotaExceededException = "ServiceQuotaExceededException"
        case throttlingException = "ThrottlingException"
        case validationException = "ValidationException"
    }

    private let error: Code
    public let context: AWSErrorContext?

    /// initialize B2bi
    public init?(errorCode: String, context: AWSErrorContext) {
        guard let error = Code(rawValue: errorCode) else { return nil }
        self.error = error
        self.context = context
    }

    internal init(_ error: Code) {
        self.error = error
        self.context = nil
    }

    /// return error code string
    public var errorCode: String { self.error.rawValue }

    /// You do not have sufficient access to perform this action.
    public static var accessDeniedException: Self { .init(.accessDeniedException) }
    /// A conflict exception is thrown when you attempt to delete a resource (such as a profile or a capability) that is being used by other resources.
    public static var conflictException: Self { .init(.conflictException) }
    /// This exception is thrown when an error occurs in the Amazon Web Services B2B Data Interchange service.
    public static var internalServerException: Self { .init(.internalServerException) }
    /// Occurs when the requested resource does not exist, or cannot be found. In some cases, the resource exists in a region other than the region specified in the API call.
    public static var resourceNotFoundException: Self { .init(.resourceNotFoundException) }
    /// Occurs when the calling command attempts to exceed one of the service quotas, for example trying to create a capability when you already have the maximum number of capabilities allowed.
    public static var serviceQuotaExceededException: Self { .init(.serviceQuotaExceededException) }
    /// The request was denied due to throttling: the data speed and rendering may be limited depending on various parameters and conditions.
    public static var throttlingException: Self { .init(.throttlingException) }
    /// Occurs when a B2BI object cannot be validated against a request from another object.
    public static var validationException: Self { .init(.validationException) }
}

extension B2biErrorType: AWSServiceErrorType {
    public static let errorCodeMap: [String: AWSErrorShape.Type] = [
        "InternalServerException": B2bi.InternalServerException.self,
        "ServiceQuotaExceededException": B2bi.ServiceQuotaExceededException.self,
        "ThrottlingException": B2bi.ThrottlingException.self
    ]
}

extension B2biErrorType: Equatable {
    public static func == (lhs: B2biErrorType, rhs: B2biErrorType) -> Bool {
        lhs.error == rhs.error
    }
}

extension B2biErrorType: CustomStringConvertible {
    public var description: String {
        return "\(self.error.rawValue): \(self.message ?? "")"
    }
}
